import React from "react";
import { BrowserRouter as Router, Link } from 'react-router-dom'
import { Navbar } from "../components/navbar";

const LayoutApp = () => {
    return (
        <>
            <Navbar />
            <Link path="/" element={<Shop />}></Link>
            <Link path="/cart" element={<Cart />}></Link>
        </>
    );
}

export default LayoutApp;
